import React, { useState, useEffect } from "react";

const ModalListUser = ({ showModal, setShowModal }) => {
    const handleModalClose = () => {
      setShowModal(false);
    };
  
    return (
      <div>
        <div className={`modal ${showModal ? "show" : ""}`} tabIndex="-1">
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Modal title</h5>
                <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
              </div>
              <div className="modal-body">
                <p>Modal body text goes here.</p>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" data-bs-dismiss="modal" onClick={handleModalClose}>
                  Close
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  };
export default ModalListUser;
